import React from 'react';
import PropTypes from 'prop-types';

import { FixedLayout, Panel, PanelHeader, PanelHeaderBack, View, Group } from '@vkontakte/vkui';
import MessageList from '../components/MessageList';
import MessageBox from '../components/MessageBox';

const Chat = props => (
    <View>
        <Panel id={props.id}>
            <PanelHeader
                left={<PanelHeaderBack onClick={props.go} data-to="home" />}
            >
                Chat
            </PanelHeader>
            <Group>
                <FixedLayout>
                    <MessageList style={{ paddingTop: 60, paddingBottom: 60, color: "gray" }}></MessageList>
                </FixedLayout>
                
            </Group>
        </Panel>
    </View >
);

Chat.propTypes = {
    id: PropTypes.string.isRequired,
    go: PropTypes.func.isRequired,
};

export default Chat;
